data:
  default.conf: "##\n# You should look at the following URL's in order to grasp a
    solid understanding\n# of Nginx configuration files in order to fully unleash
    the power of Nginx.\n# https://www.nginx.com/resources/wiki/start/\n# https://www.nginx.com/resources/wiki/start/topics/tutorials/config_pitfalls/\n#
    https://wiki.debian.org/Nginx/DirectoryStructure\n#\n# In most cases, administrators
    will remove this file from sites-enabled/ and\n# leave it as reference inside
    of sites-available where it will continue to be\n# updated by the nginx packaging
    team.\n#\n# This file will automatically load configuration files provided by
    other\n# applications, such as Drupal or Wordpress. These applications will be
    made\n# available underneath a path with that package name, such as /drupal8.\n#\n#
    Please see /usr/share/doc/nginx-doc/examples/ for more detailed examples.\n##\n\n#
    Default server configuration\n#\nserver {\n\tlisten 80;\t\n\tlocation / {\n\tproxy_pass
    http://rasa:5005;\n\t}\n\t#return 301 https://$host$request_uri;\n}\nserver {\n\n\tlisten
    443 ssl;\n\n\tserver_name rasabot.life;\n    ssl_certificate /etc/letsencrypt/live/rasabot.life/fullchain.pem;
    # managed by Certbot\n    ssl_certificate_key /etc/letsencrypt/live/rasabot.life/privkey.pem;
    # managed by Certbot\n\tssl on;\n\n\tssl_session_cache builtin:1000 shared:SSL:10m;\n\n\tssl_protocols
    TLSv1 TLSv1.1 TLSv1.2;\n\n\tssl_ciphers HIGH:!aNULL:!eNULL:!EXPORT:!CAMELLIA:!DES:!MD5:!PSK:!RC4;\n\n\tssl_prefer_server_ciphers
    on;\n\n\taccess_log /var/log/nginx/access.log;\n\n\tlocation / {\n\n\tproxy_set_header
    Host $host;\n\tproxy_set_header X-Real-IP $remote_addr;\n\n\tproxy_set_header
    X-Forwarded-For $proxy_add_x_forwarded_for;\n\n\tproxy_set_header X-Forwarded-Proto
    $scheme;\n\n\tproxy_pass http://rasa:5005;\n\n\tproxy_read_timeout 90;\n\n\tproxy_redirect
    http://rasa:5005 https://rasabot.life;\n\n\t}\n\t# pass PHP scripts to FastCGI
    server\n\t#\n\t#location ~ \\.php$ {\n\t#\tinclude snippets/fastcgi-php.conf;\n\t#\n\t#\t#
    With php-fpm (or other unix sockets):\n\t#\tfastcgi_pass unix:/var/run/php/php7.2-fpm.sock;\n\t#\t#
    With php-cgi (or other tcp sockets):\n\t#\tfastcgi_pass 127.0.0.1:9000;\n\t#}\n\n\t#
    deny access to .htaccess files, if Apache's document root\n\t# concurs with nginx's
    one\n\t#\n\t#location ~ /\\.ht {\n\t#\tdeny all;\n\t#}\n\n}\n\n\n# Virtual Host
    configuration for example.com\n#\n# You can move that to a different file under
    sites-available/ and symlink that\n# to sites-enabled/ to enable it.\n#\n#server
    {\n#\tlisten 80;\n#\tlisten [::]:80;\n#\n#\tserver_name example.com;\n#\n#\troot
    /var/www/example.com;\n#\tindex index.html;\n#\n#\tlocation / {\n#\t\ttry_files
    $uri $uri/ =404;\n#\t}\n#}\n"
